import React from 'react';
import Button from '@material-ui/core/Button';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import DialogTitle from '@material-ui/core/DialogTitle';

export default class ContinueDialogue extends React.Component {
  constructor(props){
    super(props);
    this.state = {
      open:false,
      setOpen:false
    }
  }

  handleClickOpen() {
    this.setState({
      setOpen:true
    })
  }

  handleClose() {
    this.setState({
      setOpen:false
    })
  }

  render(){
    return(
      <div>
      <Dialog
        open={this.state.open}
        onClose={this.handleClose}
        aria-labelledby="alert-dialog-title"
        aria-describedby="alert-dialog-description"
      >
        <DialogTitle id="alert-dialog-title">{"Wrong Step"}</DialogTitle>
        <DialogContent>
          <DialogContentText id="alert-dialog-description">
            This box is currently at a different step.
            Continue Anyway?
          </DialogContentText>
        </DialogContent>
        <DialogActions>
          <Button id="yes" onClick={(event) => onClick(event)} color="primary">
            YES
          </Button>
          <Button id = "no" onClick={this.handleClose} color="primary" autoFocus>
            NO
          </Button>
        </DialogActions>
      </Dialog>
    </div>

    )
  }
}
